            <ul>
              <li>Provide and maintain our service</li>
              <li>Improve face recognition algorithms</li>
              <li>Respond to your inquiries</li>
              <li>Monitor usage patterns</li>
              <li>Detect and prevent fraud</li>
            </ul>

